function zebraPatronColors(patronColors) {
  let [lastColor, nextColor] = [patronColors[0], patronColors[1]]
  let countCebraColor = 0, ultimateZebraColor = " ", maxLastZebraColor = 0


  for (let i = 1; i < patronColors.length; i++) {

    if (patronColors[i] !== nextColor || lastColor === patronColors[i]) {
      countCebraColor = 1
    }

    countCebraColor++
    [lastColor, nextColor] = [patronColors[i], lastColor]

    if (countCebraColor > maxLastZebraColor) {
      maxLastZebraColor = countCebraColor
      ultimateZebraColor = lastColor
    }

  }

  return `${ultimateZebraColor}@${maxLastZebraColor} `;
}


